import React, { Component } from "react";
//style importer
import * as s__ from "./style";

import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';
import DashboardIcon from '@material-ui/icons/Dashboard';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import PeopleIcon from '@material-ui/icons/People';
import BarChartIcon from '@material-ui/icons/BarChart';
import LayersIcon from '@material-ui/icons/Layers';
import AssignmentIcon from '@material-ui/icons/Assignment';

//
import { ExpansionPanel, ExpansionPanelSummary, ExpansionPanelDetails } from '@material-ui/core';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
//
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Drawer from '@material-ui/core/Drawer';
import Box from '@material-ui/core/Box';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import Badge from '@material-ui/core/Badge';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Link from '@material-ui/core/Link';
import MenuIcon from '@material-ui/icons/Menu';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import NotificationsIcon from '@material-ui/icons/Notifications';
// import { mainListItems, secondaryListItems } from './listItems';
//component importer
//utils importer
// import { Link } from "react-router-dom";

type State = typeof initState;

const initState = {
  open: true
};

class NavBar extends Component<{}, State> {
  state = initState;

  // classes = useStyles();
  handleDrawerOpen = () => {
    this.setState({
      open:true
    });
  };
  handleDrawerClose = () => {
    this.setState({
      open:false
    });
  };
  // fixedHeightPaper = clsx(this.classes.paper, this.classes.fixedHeight);

  renderNavBarDoctor = () => {
    return (
        <ExpansionPanel>
          <ExpansionPanelSummary
            expandIcon={<ExpandMoreIcon />}
            aria-controls="panel1ah-content"
            id="panel1ah-header"
          >
            <ListItemIcon>
            <AssignmentIcon />
            </ListItemIcon>
            Room Mamanger
          </ExpansionPanelSummary>
          <ExpansionPanelDetails>
            <div>
              <ListItem button>
                <ListItemIcon>
                  <DashboardIcon />
                </ListItemIcon>
                <ListItemText primary="Get Room" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <ShoppingCartIcon />
                </ListItemIcon>
                <ListItemText primary="Update Room" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <ShoppingCartIcon />
                </ListItemIcon>
                <ListItemText primary="Delete Room" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <PeopleIcon />
                </ListItemIcon>
                <ListItemText primary="Get All Room" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <BarChartIcon />
                </ListItemIcon>
                <ListItemText primary="Create Room" />
              </ListItem>
            </div>
          </ExpansionPanelDetails>
        </ExpansionPanel>
    );
  };

  renderSeccondNavBar = () => {
    return (
      <div>
        <ExpansionPanel>
          <ExpansionPanelSummary
            expandIcon={<ExpandMoreIcon />}
            aria-controls="panel1ah-content"
            id="panel1ah-header"
          >
            <ListItemIcon>
            <AssignmentIcon />
            </ListItemIcon>
            Shift Mamanger
          </ExpansionPanelSummary>
          <ExpansionPanelDetails>
            <div>
              <ListItem button>
                <ListItemIcon>
                  <DashboardIcon />
                </ListItemIcon>
                <ListItemText primary="Get Shift" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <ShoppingCartIcon />
                </ListItemIcon>
                <ListItemText primary="Update Shift" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <ShoppingCartIcon />
                </ListItemIcon>
                <ListItemText primary="Delete Shift" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <PeopleIcon />
                </ListItemIcon>
                <ListItemText primary="Get All Shift" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <BarChartIcon />
                </ListItemIcon>
                <ListItemText primary="Create Shift" />
              </ListItem>
            </div>
          </ExpansionPanelDetails>
        </ExpansionPanel>
      </div>
    )
  }

  renderPatientManager=()=>{
    return (
      <div>
              <ListItem button>
                <ListItemIcon>
                  <DashboardIcon />
                </ListItemIcon>
                <ListItemText primary="Register Patient" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <ShoppingCartIcon />
                </ListItemIcon>
                <ListItemText primary="Get list patient" />
              </ListItem>
              <ListItem button>
                <ListItemIcon>
                  <ShoppingCartIcon />
                </ListItemIcon>
                <ListItemText primary="Add patient to room" />
              </ListItem>
            </div>
    )
  }

  renderToolbar = () =>{
    return (
    <div>
      <AppBar 
        position="absolute"
      >
        <Toolbar>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="open drawer"
            onClick={this.handleDrawerOpen}
            // style={{display:"block"}}
          >
            <MenuIcon />
          </IconButton>
          <Typography component="h1" variant="h6" color="inherit" noWrap >
            Dashboard
          </Typography>
          <IconButton color="inherit">
            <Badge badgeContent={4} color="secondary">
              <NotificationsIcon />
            </Badge>
          </IconButton>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        // classes={{
        //   paper: clsx(this.classes.drawerPaper, !this.state.open && this.classes.drawerPaperClose),
        // }}
        // open={this.state.open}
      >
        <div 
        // className={this.classes.toolbarIcon}
        >Close
          <IconButton 
          onClick={this.handleDrawerClose}
          >
            <ChevronLeftIcon />
          </IconButton>
        </div>
        <Divider />
        <List>{this.renderNavBarDoctor()}</List>
        <Divider />
        <List>{this.renderSeccondNavBar()}</List>
        <Divider />
        <List>{this.renderPatientManager()}</List>
      </Drawer>
    </div>
    )
  }

  render() {
    return  <s__.Container>
              {/* {this.renderNavBarDoctor()}
              {this.renderSeccondNavBar()} */}
              {this.renderToolbar()}
            </s__.Container>;
  }
}

export default NavBar;
